import numpy as np
import matplotlib.pyplot as plt
plt.style.use(["dark_background"])

"""* **Creacion de una señal con ruido**"""

fm = 2000  #frecuencia de muestreo
t = np.arange(0, 3, 1/fm)  #vector tiempo
n = len(t)    #longitud de la señal
p = 15  #cantidad de puntos a generar de una señal
amplitud_ruido = 5   #escalamiento del ruido

ampl = np.interp(np.linspace(0,p,n), np.arange(0,p), np.random.rand(p)*30)  #Señal generada
ruido = amplitud_ruido * np.random.rand(n)  #Ruido generado usando distribución normal

sen_ruidosa = ampl + ruido  #Señal ruidosa


print(n)

"""* **Mostrando señales generadas:**"""

plt.subplots(1,3,figsize=(20,4))

plt.subplot(131)
plt.plot(t,ampl)
plt.title("Señal generada")
plt.xlabel("tiempo")
plt.ylabel("Amplitud")
plt.grid()

plt.subplot(132)
plt.plot(t,ruido)
plt.title("Ruido con distribución normal generada")
plt.xlabel("tiempo")
plt.ylabel("Amplitud")
#plt.axis([0, 0.1, 0,10])
plt.grid()

plt.subplot(133)
plt.plot(t, sen_ruidosa)
plt.title("Señal ruidosa")
plt.xlabel("tiempo")
plt.ylabel("Amplitud")
plt.grid()

plt.show()

"""### **2.2. Filtro media movil**

* **Estructura del filtro:**

![promedio movil.png](https://i.ibb.co/qgv7gP5/promedio-movil.png=100x20)

* **Mas referencias teóricas: **
1. [Media Movil](https://es.wikipedia.org/wiki/Media_m%C3%B3vil)
2. Consultar el libro [2] de la bibliografia del curso en la pagina 38.

* **Aplicación del filtro media movil:**
"""

sen_filtrada = np.zeros_like(sen_ruidosa)

print(n)

k = 40  #mitad del filtro. Por lo tanto el filtro tiene orden 2k+1
for i in range(k , n-k-1):
  sen_filtrada[i]= np.mean(sen_ruidosa[i-k:i+k])   #Cada salida del filtroes el promedio de la ventana
  if i == 40:
    print(len(sen_ruidosa[i-k:i+k]))

tam_ventana = 1000*(k*2+1)/fm   #Tamaño de la ventana en milisegundos

"""* **Gráficas de los resutados:**"""

plt.subplots(1,3,figsize=(20,4))

plt.subplot(131)
plt.plot(t, sen_ruidosa, label="señal ruidosa")
plt.plot(t, sen_filtrada, 'w', label="señal filtrada")
plt.title(f'Filtro media móvil con k={tam_ventana}-ms')
plt.xlabel('Tiempo (s)')
plt.ylabel('Amplitud')
plt.grid()
plt.legend()

plt.subplot(132)
plt.plot(t, ampl,"b", label="señal ruidosa")
plt.plot(t, sen_filtrada, 'r', label="señal filtrada")
plt.title(f'Comparación señal original con la señal filtrada')
plt.xlabel('Tiempo (s)')
plt.ylabel('Amplitud')
plt.grid()
plt.legend()

plt.subplot(133)
plt.plot(t, ampl,"b", label="señal ruidosa")
plt.plot(t, sen_filtrada, 'r', label="señal filtrada")
plt.title(f'Efecto de borde con el filtro media móvil k={tam_ventana}-ms')
plt.xlabel('Tiempo (s)')
plt.ylabel('Amplitud')
plt.axis([0, 0.5, 0, 30])
plt.grid()
plt.legend()

plt.show()

"""### **2.3. Filtro Gaussiano**

* **Ecuacion para creacion del filtro:**

![Ecuacion Gaussiana](https://i.ibb.co/QCJZ27n/gauss-filter.png)


* **Referencias teoricas:**
1. [Filtro Gaussiano](https://en.wikipedia.org/wiki/Gaussian_filter)

2. [FWHM](https://https://en.wikipedia.org/wiki/Full_width_at_half_maximum#:~:text=In%20a%20distribution%2C%20full%20width,half%20of%20its%20maximum%20value.&text=If%20the%20FWHM%20of%20a,be%20integrated%20by%20simple%20multiplication.)

* **Creación del filtro gaussiano:**
"""

FWHM = 25   #Valor teórico de FWHM
k = 40    #Valor para obtener el tamaño de la ventana gaussiana 2*k=80
gt = 1000*np.arange(-k,k)/fm       #tiempo de la función gaussiana en ms.

filtro_gaussiano = np.exp(-(4*np.log(2)*gt**2)/(FWHM**2))    #creación filtro gaussiano
filtro_gaussiano_normalizado =  filtro_gaussiano / np.sum(filtro_gaussiano)

ind_flanco_bajada= k + np.argmin((filtro_gaussiano[k:]-.5)**2)      #Indice de la mitad del flanco de bajada
ind_flanco_subida = np.argmin( (filtro_gaussiano-.5)**2 )      #Indice de la mitad del flanco de subida

FWHM_calculado = gt[ind_flanco_subida] - gt[ind_flanco_bajada]   #Duración del FWHM en ms

"""* **Mostrando el filtro gaussiano construido:**"""

plt.subplots(1,2, figsize=(15,4))

plt.subplot(121)
plt.plot(gt, filtro_gaussiano, label="Filtro gaussiano")
plt.plot([gt[ind_flanco_subida], gt[ind_flanco_bajada]],
         [filtro_gaussiano[ind_flanco_subida],filtro_gaussiano[ind_flanco_bajada]],
         label = "FWHM" )             #Gráfica de la línea FWHM
plt.title(f'Filtro gaussiano con FWHM teórico de {FWHM}-ms. Logrado {FWHM_calculado}-ms ')
plt.xlabel('Tiempo (ms)')
plt.ylabel('Ganancia')
plt.grid()
plt.legend()

plt.subplot(122)
plt.plot(gt, filtro_gaussiano_normalizado, label="Filtro gaussiano normalizado")
plt.plot([gt[ind_flanco_subida], gt[ind_flanco_bajada]],
         [filtro_gaussiano_normalizado[ind_flanco_subida],filtro_gaussiano_normalizado[ind_flanco_bajada]],
         label = "FWHM" )             #Gráfica de la línea FWHM
plt.title(f'Filtro gaussiano normalizado con FWHM teórico de {FWHM}-ms. Logrado {FWHM_calculado}-ms ')
plt.xlabel('Tiempo (ms)')
plt.ylabel('Ganancia')
plt.grid()
plt.legend()
#plt.axis([-50, 50, 0, 0.01])


plt.show()

"""* **Aplicación del filtro Gaussiano:**"""

sen_filtrada_gauss = np.zeros_like(sen_ruidosa)

#Orden del filtro es 2*k=80
for i in range(k+1,n-k-1):
    sen_filtrada_gauss[i]=np.sum(sen_ruidosa[i-k:i+k]*filtro_gaussiano_normalizado)   #Salidas ponderadas

"""* **Mostrando los resultados:**"""

plt.subplots(1,3,figsize=(20,4))

plt.subplot(131)
plt.plot(t, sen_ruidosa, label="señal ruidosa")
plt.plot(t, sen_filtrada, 'w', label="señal filtrada")
plt.title(f'Filtro gaussiano con FWHM={FWHM_calculado}-ms')
plt.xlabel('Tiempo (s)')
plt.ylabel('Amplitud')
plt.grid()
plt.legend()

plt.subplot(132)
plt.plot(t, ampl,"b", label="Señal original")
plt.plot(t, sen_filtrada, 'r', label="señal filtrada")
plt.title(f'Comparación señal original con la señal filtrada')
plt.xlabel('Tiempo (s)')
plt.ylabel('Amplitud')
plt.grid()
plt.legend()

plt.subplot(133)
plt.plot(t, ampl,"b", label="Señal original")
plt.plot(t, sen_filtrada, 'r', label="Señal filtrada")
plt.title(f'Efecto de borde con el filtro Gaussiano con FWHM={tam_ventana}-ms')
plt.xlabel('Tiempo (s)')
plt.ylabel('Amplitud')
plt.axis([0, 0.5, 0, 30])
plt.grid()
plt.legend()

plt.show()

